import { Button } from "@mui/material";
import { Box } from "@mui/system";
import { useDispatch } from "react-redux";
import { addUser } from "../../slices/userSlice";
import { Colors } from "../../styles";
import { AddPlayerButton, HeaderContainer } from "../../styles/header";


export default function Header() {
    const dispatch = useDispatch();

    const addPlayer = () => {
        dispatch(addUser())
    }

    return (
        <HeaderContainer>
            <h1>Phase10</h1>
            <Box
                sx={{

                }}
            >
                <AddPlayerButton
                    variant="contained"
                    onClick={addPlayer}>
                    Add player +
                </AddPlayerButton>
            </Box>
        </HeaderContainer>
    )
}
